        state = {
            hashrate: [],
            difficulty: [],
            coinbase: [],
            blocknumber: [],
            price: [],
            volume: []
        }
        componentDidMount() {
            fetch('https://explorer.xwp.one/api/networkinfo')
            .then(res => res.json())
            .then((data) => {
            this.setState({ hashrate: data })
            })
            .catch(console.log)
        }
        render() {
            return (
                <div className="columns coinStats">
                    <div class="column is-flex"></div>
                        <Hashrate hashrate={this.state.hashrate} />
